\n    HR2\n    HR3\n    HR4  \n \n\nClass labels:\n\n    AGN \n    CV \n    STAR \n    CO\n\nUnclassified objects or objects with different class labels are shown as black circles.\n\nWarning: AGN shown here come from above the Galactic plane and will look different through the plane due to much higher absorption.\n\n\n"],["readme_text","\n\n\n&lt;img src=\"CM.png\" alt=\"CM\" style=\"width:700px;height:500px;\"&gt;\n\n\n\nFor plotting custom objects, the user should provide a csv file.\nThe following column labels are accepted (columns with other names are ignored, descriptions of each column are after the colon mark):\n\n    Name \n    ra | RA: right ascension in degrees  \n    dec | DEC: declination in degrees  \n    Class: source classifications which will be described in Class labels below \n    ref: reference for source classifications \n\n   All X-ray property columns are derived from eRASS1.  \n   \n   See&lt;a href=\"https://arxiv.org/abs/2401.17274\"&gt;  Table D.1. column description&lt;/a&gt; for details. \n\n    DET_LIKE_0 : The total band detection likelihood of the source  \n    F1:  ML_FLUX_1  (0.2 - 2.3 keV) band flux \n    FP1: ML_FLUX_P1 (0.2 - 0.5 keV) band flux \n    FP2: ML_FLUX_P2 (0.5 - 1.0 keV) band flux \n    FP3: ML_FLUX_P3 (1.0 - 2.0 keV) band flux \n    FP4: ML_FLUX_P4 (2.0 - 5.0 keV) band flux \n    FP5: ML_FLUX_P5 (5.0 - 8.0 keV) band flux \n    FP6: ML_FLUX_P6 (4.0 - 10.0 keV) band flux \n    FP7: ML_FLUX_P7 (5.1 - 6.1 keV) band flux \n    FP8: ML_FLUX_P8 (6.2 - 7.1 keV) band flux \n    FP9: ML_FLUX_P9 (7.2 - 8.2 keV) band flux \n    HR1_2: (ML_RATE_P2 - ML_RATE_P1)/(ML_RATE_P2 + ML_RATE_P1), count_rate-based hardness ratios\n    HR2_3: (ML_RATE_P3 - ML_RATE_P2)/(ML_RATE_P3 + ML_RATE_P2)\n    HR3_4: (ML_RATE_P4 - ML_RATE_P3)/(ML_RATE_P4 + ML_RATE_P3)\n    HR4_5: (ML_RATE_P5 - ML_RATE_P4)/(ML_RATE_P5 + ML_RATE_P4)\n    \n \nAll columns are optional. \n\nClass labels:\n\n    AGN: active galactic nucleus  \n    CV: cataclysmic variable  \n    STAR include:\n        HM-STAR: high-mass star, including O, B, or Wolf\u2013Rayet stars \n        LM-STAR: low-mass star, including A, F, G, K, or M type stars \n        YSO: young stellar objects\n    CO (compact objects) include: \n        HMXB: high-mass X-ray binary, including high-mass gamma-ray binaries and Gamma Cas analogs \n        LMXB: low-mass X-ray binary \n        NS: pulsar and isolated neutron star  \n        NS_BIN: nonaccreting X-ray binaries, such as wide-orbit binaries with millisecond pulsars, as well as red-back and black widow systems.   \n    \n\nUnclassified objects or objects with different class labels are shown as black circles.\n\nWarning: AGN shown here come from above the Galactic plane and will look different through the plane due to much higher absorption.\n\n\n"],["html_title","eRASS1"],["get_ref_link_js","\n\n    function get_ref_link(ref) {\n    \n        var ref_link\n        \n        if (ref=='INTEGRAL General Reference Catalog') {\n            ref_link = 'https://www.isdc.unige.ch/integral/science/catalogue'\n            ref = 'INTEGRAL'\n        }    \n        else if (ref=='Simbad' || ref=='SIMBAD')\n            ref_link = 'http://simbad.u-strasbg.fr/simbad/'\n        else if (ref=='LAMOST-DR8-AFGK' || ref=='LAMOST-DR8-M')\n            ref_link = 'http://www.lamost.org/dr8/'\n        else\n            ref_link = 'https://ui.adsabs.harvard.edu/abs/' + ref + '/abstract' \n\n        ref_link = '&lt;a href=\"' + ref_link + '\" target=\"_blank\"&gt;' + ref + '&lt;/a&gt;'    \n        console.log(ref, ref_link)\n        return [ref, ref_link]\n    \n    }\n"],["format_js"," \n\n    function format(d, shadowroot) {\n            \n        var i = Number(d.DT_RowId.slice(2))\n        \n        var name_csc = table_source.data['Name'][i]\n        \n        var div_id = `\"aladin-lite-div` + name_csc.replace(/[^A-Z0-9]+/ig, \"_\") + `\"`\n\n        var aladin_div = '&lt;div id=' + div_id + ' style=\"width:400px;height:400px;\"&g ontact&lt;/a&gt;"],["upload_help_text","\n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\nFor plotting custom objects, the user should provide a csv file.\nThe following column labels are accepted (columns with other names are ignored):\n\n    name \n    ra \n    dec \n    Class \n    ref \n    DET_LIKE_0\n    F1\n    FP1 \n    FP2 \n    FP3\n    FP4 \n    FP5 \n    FP6 \n    FP7 \n    FP8\n    FP9\n    HR1 \n    HR2\n    HR3\n    HR4  \n \n\nClass labels:\n\n    AGN \n    CV \n    STAR \n    CO\n\nUnclassified objects or objects with different class labels are shown as black circles.\n\nWarning: AGN shown here come from above the Galactic plane and will look different through the plane due to much higher absorption.\n\n\n"],["readme_text","\n\n\n&lt;img src=\"CM.png\" alt=\"CM\" style=\"width:700px;height:500px;\"&gt;\n\n\n\nFor plotting custom objects, the user should provide a csv file.\nThe following column labels are accepted (columns with other names are ignored, descriptions of each column are after the colon mark):\n\n    Name \n    ra | RA: right ascension in degrees  \n    dec | DEC: declination in degrees  \n    Class: source classifications which will be described in Class labels below \n    ref: reference for source classifications \n\n   All X-ray property columns are derived from eRASS1.  \n   \n   See&lt;a href=\"https://arxiv.org/abs/2401.17274\"&gt;  Table D.1. column description&lt;/a&gt; for details. \n\n    DET_LIKE_0 : The total band detection likelihood of the source  \n    F1:  ML_FLUX_1  (0.2 - 2.3 keV) band flux \n    FP1: ML_FLUX_P1 (0.2 - 0.5 keV) band flux \n    FP2: ML_FLUX_P2 (0.5 - 1.0 keV) band flux \n    FP3: ML_FLUX_P3 (1.0 - 2.0 keV) band flux \n    FP4: ML_FLUX_P4 (2.0 - 5.0 keV) band flux \n    FP5: ML_FLUX_P5 (5.0 - 8.0 keV) band flux \n    FP6: ML_FLUX_P6 (4.0 - 10.0 keV) band flux \n    FP7: ML_FLUX_P7 (5.1 - 6.1 keV) band flux \n    FP8: ML_FLUX_P8 (6.2 - 7.1 keV) band flux \n    FP9: ML_FLUX_P9 (7.2 - 8.2 keV) band flux \n    HR1_2: (ML_RATE_P2 - ML_RATE_P1)/(ML_RATE_P2 + ML_RATE_P1), count_rate-based hardness ratios\n    HR2_3: (ML_RATE_P3 - ML_RATE_P2)/(ML_RATE_P3 + ML_RATE_P2)\n    HR3_4: (ML_RATE_P4 - ML_RATE_P3)/(ML_RATE_P4 + ML_RATE_P3)\n    HR4_5: (ML_RATE_P5 - ML_RATE_P4)/(ML_RATE_P5 + ML_RATE_P4)\n    \n \nAll columns are optional. \n\nClass labels:\n\n    AGN: active galactic nucleus  \n    CV: cataclysmic variable  \n    STAR include:\n        HM-STAR: high-mass star, including O, B, or Wolf\u2013Rayet stars \n        LM-STAR: low-mass star, including A, F, G, K, or M type stars \n        YSO: young stellar objects\n    CO (compact objects) include: \n        HMXB: high-mass X-ray binary, including high-mass gamma-ray binaries and Gamma Cas analogs \n        LMXB: low-mass X-ray binary \n        NS: pulsar and isolated neutron star  \n        NS_BIN: nonaccreting X-ray binaries, such as wide-orbit binaries with millisecond pulsars, as well as red-back and black widow systems.   \n    \n\nUnclassified objects or objects with different class labels are shown as black circles.\n\nWarning: AGN shown here come from above the Galactic plane and will look different through the plane due to much higher absorption.\n\n\n"],["html_title","eRASS1"],["get_ref_link_js","\n\n    function get_ref_link(ref) {\n    \n        var ref_link\n        \n        if (ref=='INTEGRAL General Reference Catalog') {\n            ref_link = 'https://www.isdc.unige.ch/integral/science/catalogue'\n            ref = 'INTEGRAL'\n        }    \n        else if (ref=='Simbad' || ref=='SIMBAD')\n            ref_link = 'http://simbad.u-strasbg.fr/simbad/'\n        else if (ref=='LAMOST-DR8-AFGK' || ref=='LAMOST-DR8-M')\n            ref_link = 'http://www.lamost.org/dr8/'\n        else\n            ref_link = 'https://ui.adsabs.harvard.edu/abs/' + ref + '/abstract' \n\n        ref_link = '&lt;a href=\"' + ref_link + '\" target=\"_blank\"&gt;' + ref + '&lt;/a&gt;'    \n        console.log(ref, ref_link)\n \n                    s = !s;\n                } \n                else if (',' == l &amp;&amp; s) \n                    l = row[++i] = '';\n                else if ('\\n' == l &amp;&amp; s) {\n                    if ('\\r' == p) row[i] = row[i].slice(0, -1);\n                    row = ret[++r] = [l = '']; \n                    i = 0;\n                } \n                else row[i] += l;\n                p = l;\n            }\n            return ret;\n        }\n        \n        let obj = csvToArray(atob(this.value).trim())\n\n        let len = obj.length - 1\n\n        //transpose\n        obj = obj[0].map((col, i) =&gt; obj.map(([...row]) =&gt; row[i]))\n\n        let df_custom = {}\n        \n        // !!!\n        \n        for (var ob of obj) {\n        \n            let name = ob[0]\n        \n            if (!(name in all_dict)) {\n            \n                if (name in q['all']) \n                        \n                    name = q['all'][name]['label'] \n                                      \n                else continue\n                                        \n            } \n\n            let sl = ob.slice(1)\n            \n            if (name in all_dict)             \n                if (all_dict[name]['format'].match(/to/) != null)\n                    sl = sl.map(parseFloat)\n\n            df_custom[name] = sl    \n        }\n        \n            \n        function replace_from_dict(arr, dic) {\n\n            var out = [];\n            \n            for (var i=0; i&lt;arr.length; i++) {\n            \n                 var cl = arr[i];\n                 \n                 if (cl in dic)                \n                     out.push(dic[cl])\n                 else    \n                     out.push(cl)\n                       \n            }\n            \n            return out\n            \n         }   \n         \n         df_custom[q['class_column']] = replace_from_dict(df_custom[q['class_column']], q['classes_dict']) \n \n\n        \n\n        var feat_x = features[sel_x.active]\n        var feat_y = features[sel_y.active]\n\n        if (log_source.data[feat_x][0] == 1) {\n        \n            if (['P_intra', 'P_inter'].includes(feat_x))         \n                df_custom['x'] = df_custom[feat_x].map(x =&gt; Math.log10(1/(1.001 - x)))   \n            else\n                df_custom['x'] = df_custom[feat_x].map(x =&gt; Math.log10(x)) \n            \n        } else { \n            if (['P_intra', 'P_inter'].includes(feat_x))         \n                df_custom['x'] = df_custom[feat_x].map(x =&gt; 1/(1.001 - x))   \n            else\n                df_custom['x'] = df_custom[feat_x]\n        }         \n \n        if (log_source.data[feat_y][0] == 1) {\n        \n            if (['P_intra', 'P_inter'].includes(feat_y))         \n                df_custom['y'] = df_custom[feat_y].map(x =&gt; Math.log10(1/(1.001 - x)))   \n            else\n                df_custom['y'] = df_custom[feat_y].map(x =&gt; Math.log10(x)) \n            \n        } else { \n            if (['P_intra', 'P_inter'].includes(feat_y))         \n                df_custom['y'] = df_custom[feat_y].map(x =&gt; 1/(1.001 - x))   \n            else\n                df_custom['y'] = df_custom[feat_y]\n        }         \n        \n        df_custom['color'] = []\n\n        for (var x of df_custom[class_column]) {\n\n            if (colors_dict[x])\n                df_custom['color'].push(colors_dict[x])\n            else    \n                df_custom['color'].push('black')\n         }       \n\n        df_custom['line_color'] = Array(len).fill('black')\n        df_custom['size'] = Array(len).fill(15)\n\n        var r = {}\n\n        for (const [k, v] of Object.entries(df_custom)) { \n\n            var b = df_custom[k]\n\n            var c = new Array()            \n            for (var i of b)\n                c.push(i)   \n\n            r[k] = c\n\n        }  \n\n        sources['custom'].data = r    \n\n        sources['custom'].change.emit() \n\n        //obj = Object.entries(obj)    \n        //let obj_dict = Object.assign({}, ...obj.map((x) =&gt; ({[x[0]]: x[1:]}))) \n        //const obj2 = Object.fromEntries(obj[:,0].map((key, index)=&gt; [key, obj[index, 1:]))\n\n    "}},{"id":"p1874"},{"id":"p1883"}]]]},"width":200,"accept":".csv"}},{"id":"p1851"},{"type":"object","name":"Div","id":"p1844","attributes":{"text":"\n\n        \n    &lt;style&gt;\n        body {font-family: Arial, Helvetica, sans-serif;}\n\n        /* The Modal (background) */\n        .modal {\n          display: none; /* Hidden by default */\n          position: fixed; /* Stay in place */\n          z-index: 1; /* Sit on top */\n          padding-top: 50px; /* Location of the box */\n          padding-bottom: 50px;\n          left: 400px;\n          top: 0;\n          width: 50%; /* Full width */\n          height: 100%; /* Full height */\n          overflow: auto; /* Enable scroll if needed */\n          background-color: rgb(0,0,0); /* Fallback color */\n          background-color: rgba(0,0,0,0.4); /* Black w/ opacity */\n        }\n\n        /* Modal Content */\n        .modal-content {\n          background-color: #fefefe;\n          margin: auto;\n          padding: 20px;\n          border: 1px solid #888;\n          width: 80%;\n          white-space: pre-wrap;\n        }    \n    &lt;/style&gt;\n    \n\n        &lt;div id=\"readme\" class=\"modal\", style=\"display: none;\"&gt;\n\n            &lt;button onclick='document.querySelector(\"div\").children[0].shadowRoot.querySelector(\"div:nth-child(7)\").shadowRoot.querySelector(\"div:nth-child(8)\").shadowRoot.querySelector(\"div:nth-child(7)\").shadowRoot.querySelector(\"div:nth-child(19)\").shadowRoot.querySelector(\"#readme\").style.display=\"none\"'&gt;Close\n            &lt;/button&gt; \n\n            &lt;div class=\"modal-content\"&gt;\n\n                \n\n\n&lt;img src=\"CM.png\" alt=\"CM\" style=\"width:700px;height:500px;\"&gt;\n\n\n\nFor plotting custom objects, the user should provide a csv file.\nThe following column labels are accepted (columns with other names are ignored, descriptions of each column are after the colon mark):\n\n    Name \n    ra | RA: right ascension in degrees  \n    dec | DEC: declination in degrees  \n    Class: source classifications which will be described in Class labels below \n    ref: reference for source classifications \n\n   All X-ray property columns are derived from eRASS1.  \n   \n   See&lt;a href=\"https://arxiv.org/abs/2401.17274\"&gt;  Table D.1. column description&lt;/a&gt; for details. \n\n    DET_LIKE_0 : The total band detection likelihood of the source  \n    F1:  ML_FLUX_1  (0.2 - 2.3 keV) band flux \n    FP1: ML_FLUX_P1 (0.2 - 0.5 keV) band flux \n    FP2: ML_FLUX_P2 (0.5 - 1.0 keV) band flux \n    FP3: ML_FLUX_P3 (1.0 - 2.0 keV) band flux \n    FP4: ML_FLUX_P4 (2.0 - 5.0 keV) band flux \n    FP5: ML_FLUX_P5 (5.0 - 8.0 keV) band flux \n    FP6: ML_FLUX_P6 (4.0 - 10.0 keV) band flux \n    FP7: ML_FLUX_P7 (5.1 - 6.1 keV) band flux \n    FP8: ML_FLUX_P8 (6.2 - 7.1 keV) band flux \n    FP9: ML_FLUX_P9 (7.2 - 8.2 keV) band flux \n    HR1_2: (ML_RATE_P2 - ML_RATE_P1)/(ML_RATE_P2 + ML_RATE_P1), count_rate-based hardness ratios\n    HR2_3: (ML_RATE_P3 - ML_RATE_P2)/(ML_RATE_P3 + ML_RATE_P2)\n    HR3_4: (ML_RATE_P4 - ML_RATE_P3)/(ML_RATE_P4 + ML_RATE_P3)\n    HR4_5: (ML_RATE_P5 - ML_RATE_P4)/(ML_RATE_P5 + ML_RATE_P4)\n    \n \nAll columns are optional. \n\nClass labels:\n\n    AGN: active galactic nucleus  \n    CV: cataclysmic variable  \n    STAR include:\n        HM-STAR: high-mass star, including O, B, or Wolf\u2013Rayet stars \n        LM-STAR: low-mass star, including A, F, G, K, or M type stars \n        YSO: young stellar objects\n    CO (compact objects) include: \n        HMXB: high-mass X-ray binary, including high-mass gamma-ray binaries and Gamma Cas analogs \n        LMXB: low-mass X-ray binary \n        NS: pulsar and isolated neutron star  \n        NS_BIN: nonaccreting X-ray binaries, such as wide-orbit binaries with millisecond pulsars, as well as red-back and black widow systems.   \n    \n\nUnclassified objects or objects with different class labels are shown as black circles.\n\nWarning: AGN shown here come from above the Galactic plane and will look different through the plane due to much higher absorption.\n\n\n\n\n            &lt;/div&gt;        \n\n        &lt;/div&gt;  \n\n        "}},{"type":"object","name":"Div","id":"p1847","attributes":{"text":"\n\n        \n    &lt;style&gt;\n        body {font-family: Arial, Helvetica, sans-serif;}\n\n        /* The Modal (background) */\n        .modal {\n          display: none; /* Hidden by default */\n          position: fixed; /* Stay in place */\n          z-index: 1; /* Sit on top */\n          padding-top: 50px; /* Location of the box */\n          padding-bottom: 50px;\n          left: 400px;\n          top: 0;\n          width: 50%; /* Full width */\n          height: 100%; /* Full height */\n          overflow: auto; /* Enable scroll if needed */\n          background-color: rgb(0,0,0); /* Fallback color */\n          background-color: rgba(0,0,0,0.4); /* Black w/ opacity */\n        }\n\n        /* Modal Content */\n        .modal-content {\n          background-color: #fefefe;\n          margin: auto;\n          padding: 20px;\n          border: 1px solid #888;\n          width: 80%;\n          white-space: pre-wrap;\n        }    \n    &lt;/style&gt;\n    \n\n        &lt;div id=\"upload_help\" class=\"modal\", style=\"display: none;\"&gt;\n\n            &lt;button onclick='document.querySelector(\"div\").children[0].shadowRoot.querySelector(\"div:nth-child(7)\").shadowRoot.querySelector(\"div:nth-child(8)\").shadowRoot.querySelector(\"div:nth-child(7)\").shadowRoot.querySelector(\"div:nth-child(20)\").shadowRoot.querySelector(\"#upload_help\").style.display=\"none\"'&gt;Close\n            &lt;/button&gt; \n\n            &lt;div class=\"modal-content\"&gt
